import 'bootstrap/dist/css/bootstrap.min.css'
import { useEffect } from 'react'
import { 
    Container,
    Button,
    Form
 } from 'react-bootstrap'
 import { RadioGroup, RadioButton } from 'react-radio-buttons'
import { Link, useRouteMatch } from 'react-router-dom'
import axios from "axios"
import { useState } from "react"

const EngineerTakeQuiz = () => {
    const [quiz, setQuiz] = useState([])

    const { url } = useRouteMatch()

    useEffect(() => {
        axios.get("http://127.0.0.1:5000/quiz/getQuestions").then((res) => {
          setQuiz(res.data);
        });
      }, []);

    return(
        <Container>
            <h1>All courses</h1>
            {quiz.map(quiz =>
              <Container key={quiz.question_id}>
                  <h3>{quiz.question}</h3>
                  <h5>{quiz.duration}</h5>
                  <RadioButton>{quiz.option1}</RadioButton>
                  <RadioButton>{quiz.option2}</RadioButton>
                  {/* if ({quiz.option3} != '') {
                    <RadioButton>{quiz.option3}</RadioButton>
                  }
                  <RadioButton>{quiz.option4}</RadioButton> */}
              </Container>
            )}
        </Container>
    )
}

export default EngineerTakeQuiz
